import styled from "styled-components";

const Wrapper = styled.section`
  max-width: var(--max-width);
  margin: 14rem auto 5rem auto;
  margin-top: 14rem;

  .content {
    max-width: var(--max-width-content);
    margin: 0 auto;

    .flex_top {
      display: flex;
      align-items: center;
      gap: 1.6rem;
      .rectangle {
        width: 2rem;
        height: 4rem;
        background: #db4444;
        border-radius: 0.4rem;
      }

      .title_cate {
        font-size: 1.6rem;
        color: #db4444;
        font-weight: 600;
      }
    }
  }
`;

export default Wrapper;
